(4, 'ELECTRIC CARS', 'An electric car also called battery electric car is a plug â€“in electric automobile that is propelled by an electric motors, using a rechargeable battery which is recharge by electricity.', '<p><img alt=\"...\" src=\"https://inspireclubnitrkl.com/articles-img/2.1.jpg\" /></p>\r\n\r\n<h3><strong>ABSTRACT</strong></h3>\r\n\r\n<p>An electric car also called battery electric car is a plug &ndash;in electric automobile that is propelled by an electric motors, using a rechargeable battery which is recharge by electricity. Charging an electric car can be done by a variety of methods in the charging stations, these charging stations are mainly located in house and public areas. We have two types of electric vehicle: hybrid and pure electric. Electric car comes with different components which help it operation.</p>\r\n\r\n<h3>INTRODUCTION TO ELECTRIC CAR</h3>\r\n\r\n<p>An electric car also called battery electric car is a plug &ndash;in electric automobile that is propelled by an electric motors, using a rechargeable battery which is recharge by electricity. From 2008, manufacturing of electric car comes into play due to many issues arising such as; high fuel consumption, emission rate, maintenance and so on.</p>\r\n\r\n<p>Charging an electric car can be done by a variety of methods in the charging stations, these charging stations are mainly located in house and public areas. The two all-time best selling electric cars, Nissan Leaf and the Tesla Model S, have EPA rated ranges reaching up to 151 mi and 335 mi respectively. Electric car are a variety of electric vehicle. The term electric vehicle implies any vehicle that uses electric motors for propulsion while electric car refers to highway-capable automobiles powered by electricity. An electric vehicle may be powered through a collector system by electricity from off-vehicle sources or may be by a self-contained with a battery, solar panels or an electric generator to convert fuel to electricity.</p>\r\n\r\n<h3>HISTORY OF ELECTRIC CARS</h3>\r\n\r\n<p>Electric cars are nothing new, around 1900s interest in motor vehicles increases and around then there were about twice as many electric cars on the road than petrol/diesel cars. Only in 1920s that interest in electric vehicle dwindled due to reduced speed and low travelling range.</p>\r\n\r\n<p>Henry Ford was the one who put the nail in the electric car coffin when his company began to mass-produce the Model T. This slashed the price of petrol cars to about half of that an electric car and so in the early 1900s almost all electric car manufacturers began to cease making them.</p>\r\n\r\n<p>Interest in electric cars returned following the energy crises of the 1970s and 80s; with the availability and price of oil being shown to be increasingly volatile. People could see the benefits of battery-powered cars. However electric vehicles were still losing out to the style and lower price of their petrol-fuelled cousins. In the 2000s, the development of hybrid vehicles, plus other fuel crises saw the technology adopted by larger numbers than before. As of September 2016, there were more than one million pure electric cars and vans owned globally.</p>\r\n\r\n<h3>How do electric cars work?</h3>\r\n\r\n<p>We have two types of electric vehicle: hybrid and pure electric.</p>\r\n\r\n<h4>Pure Electric car</h4>\r\n\r\n<p>It consists of rechargeable battery, controller and electric motor. The battery is powered. Then the controller converts DC to AC so it can be used by the motor. The motor then converts electrical energy to mechanical energy for the vehicle movement.</p>\r\n\r\n<h4>Hybrid electric car</h4>\r\n\r\n<p>The same technology exists in hybrid cars, alongside a small gasoline engine running a generator. This power the car at cruising speed and batteries provides extra power during acceleration.</p>\r\n\r\n<h3>Benefits of electric cars</h3>\r\n\r\n<ul>\r\n	<li>No emission is release</li>\r\n	<li>They offer a smooth drive with less effort</li>\r\n	<li>They are cheaper to run</li>\r\n	<li>Solves problem arising from non-renewable energy source</li>\r\n	<li>Does not contribute to green house emission like petrol vehicles</li>\r\n	<li>It is also eco-friendly.</li>\r\n</ul>\r\n\r\n<h3>Drawbacks of electric vehicles</h3>\r\n\r\n<ul>\r\n	<li>It is affected by weather condition</li>\r\n	<li>They normally take a longer time to charge depending on car and charger</li>\r\n	<li>Charging points are not easily accessible</li>\r\n</ul>\r\n\r\n<h3>Electric vehicle Main Components</h3>\r\n\r\n<h4>Motor</h4>\r\n\r\n<p>The motor converts electrical energy into kinetic energy that moves the wheel. The advantage of using the motor instead of an engine is numerous. The noise and vibration is minimized. The electric vehicle power train is smaller than the engine, thus providing lots of additional space for efficient vehicle design</p>\r\n\r\n<p>The motor also serves as an electric generator that converts the kinetic energy generated while in neutral gear into electric saved to the battery. Some of the Hyundai Motor Group&rsquo;s EV&rsquo;S are equipped with a mechanism that can control the levels of regenerative braking via paddle shifters on the steering wheel.</p>\r\n\r\n<h4>Reducer</h4>\r\n\r\n<p>The reducer helps to easily convey the motor&rsquo;s power to the wheel. But it carries the special name-reducer-for a reason. The motor has a far higher RPM than that of an internal combustion engine, so whereas the transmission changes the engine RPM to match the driving circumstances.</p>\r\n\r\n<h4>Battery</h4>\r\n\r\n<p>The battery stores electrical energy which is equivalent to fuel tank which store fuel in petrol engine. The distance an EV can travel to is usually determine by the battery capacity. The higher the capacity the higher the distance travels and vice versa. Increasingly the capacity of the battery now depends because the increase would cause increase in the time needed to be stopping at each charging stations.</p>\r\n\r\n<p>Thanks to the recent advancement in battery technology, the more recent EV has a higher upgrade over the last models in terms of battery capacity and distance travel. The battery life which is the life span of the battery also increases.</p>\r\n\r\n<h4>Battery Management System (BMS)</h4>\r\n\r\n<p>The BMS manage the battery cells so they can operate as if they are a single entity. The EV&rsquo;s battery consists of as little as tens to as many as thousands of mini-cells and each cells needs to be in a nearly same condition to the other s to optimize the battery&rsquo;s durability.</p>\r\n\r\n<p>Most often the BMS is built into battery&rsquo;s body, though sometimes it is incorporated into the Electric Power Control Unit. The BMS mainly oversees the cell&rsquo;s charge/discharge status, but when it sees a malfunctioning cell, it automatically adjusts the power status.</p>\r\n\r\n<h4>Battery Heating System</h4>\r\n\r\n<p>In lower temperatures, the battery sees a decrease in both charging and speed. The battery heater exists to keep the battery within the normal temperature range and also maintaining the maximum distance to be cover. It also functions while charging to ensure efficiency of the charge.</p>\r\n\r\n<h4>Electric Power Control Unit (EPCU)</h4>\r\n\r\n<p>The EPCU is an efficient integration of nearly all devices that control the flow of the electric power in the vehicle. It consists of the following;</p>\r\n\r\n<h5>Inverter</h5>\r\n\r\n<p>The inverter converts the battery&rsquo;s DC into AC which then is used to control the motor speed. It execute acceleration, deceleration.</p>\r\n\r\n<h5>Low voltage DC-DC Converter</h5>\r\n\r\n<p>This helps to convert the high voltage electricity from the EV&rsquo;S into low voltage and supplies it to the vehicle&rsquo;s various electronic systems.</p>\r\n\r\n<h5>Vehicle Control Unit</h5>\r\n\r\n<p>As the control tower of all electric power control systems in the vehicle, the VCU is arguably the most important part of EPCU. It oversees nearly all the vehicle&rsquo;s power control mechanism.</p>\r\n\r\n<h4>Charge Port</h4>\r\n\r\n<p>The charge port allows the vehicle to connect to an external power supply which charges the traction battery pack.</p>\r\n\r\n<h3>CONCLUSION</h3>\r\n\r\n<p>From various manufacturers now producing electric car various development have evolved over time from the battery down to electric motor for propelling. However, the major challenging factor in it is the battery which is still expensive and easily discharged especially when raining. According to expert prediction some years to come electric car will dominate.</p>\r\n', , 'Jagannath Behera', '2021-09-02 11:13:46');
INSERT INTO `articles_new` (`sl_no`, `title`, `description`, `article_content`, `thumbnail`, `author`, `time`) VALUES
(5, 'BLOCKCHAIN', 'Blockchain, a potential bedrock of the worldwide record-keeping systems, can be a revolutionary breakthrough in this world full of mastermind hackers and cyber threats. Blockchain technology is poised to change IT in much the same way open-source software did a quarter century ago', '<h1><u>BLOCKCHAIN</u></h1>\r\n\r\n<p><img alt=\"...\" src=\"https://inspireclubnitrkl.com/articles-img/3.3.jpg\" style=\"height:300px; width:500px\" /></p>\r\n\r\n<p>Blockchain, a potential bedrock of the worldwide record-keeping systems, can be a revolutionary breakthrough in this world full of mastermind hackers and cyber threats. Blockchain technology is poised to change IT in much the same way open-source software did a quarter century ago. Based on a peer-to-peer topology, it is a distributed ledger technology (DLT) that helps data to be stored globally under thousand of servers- while letting anyone on the network see everyone else&rsquo;s entry in near real time.</p>\r\n\r\n<p><strong>HISTORY</strong>- The idea behind blockchain technology was described as early as 1991 when research scientists Stuart Haber and W. Scott Stornetta introduced a computationally practical solution for time stamping digital documents for betterment of non-tampering. They used a cryptographically secured chain of blocks to store the time stamped docs. However this technology went unused and the patenet lapsed in 2004. Then in 2004 a system was introduced called RPoW, reusable proof of work. The system worked by receiving a non-exchangeable or a non-fungible Hashcash based proof of work token and in return created an RSA signed token that could then be transferred from person to person. RPoW can be considered as an early prototype in the history of cryptocurrencies. In late 2008 a white paper introduced a decentralized peer-to-peer electronic cash system called bitcoin, was posted to a cryptography mailing list by any group or person using the pseudonym Satoshi Nakamoto. In 2014 Blockchain technology is separated from the currency and its potential for other financial, inter-organisational transactions is explored. Blockchain 2.0 is born, referring to applications beyond currency.The Ethereum blockchain system introduces computer programs into the blocks, representing financial instruments such as bonds. These become known as smart contracts.</p>\r\n\r\n<p><img alt=\"...\" src=\"https://inspireclubnitrkl.com/articles-img/3.2.png\" style=\"height:418px; width:500px\" /></p>\r\n\r\n<p><strong>Bitcoin&rsquo;s role</strong>&nbsp;- Posting their seminal whitepaper in 2008 and launching the initial code in 2009, Nakamoto created bitcoin to be a form of cash that could be sent peer-to-peer without the need for a central bank or other authority to operate and maintain the ledger, much as how physical cash can be. While it wasn&rsquo;t the first online currency to be proposed, the bitcoin proposal solved several problems in the field and has been by far the most successful version. The engine that runs the bitcoin ledger that Nakamoto designed is called the blockchain; the original and largest blockchain is the one that still orchestrates bitcoin transactions today.</p>\r\n\r\n<p>The second generation - Other blockchains include those that run the several hundred &ldquo;altcoins&rdquo; &ndash; other similar currency projects with different rules &ndash; as well as truly different applications, such as:</p>\r\n\r\n<p><strong>Ethereum:</strong>&nbsp;the second largest blockchain implementation after bitcoin. Ethereum distributes a currency called ether, but also allows for the storage and operation of computer code, allowing for smart contracts.</p>\r\n\r\n<p><strong>Ripple:</strong>&nbsp;a real-time gross settlement system, currency exchange and remittance network, based on a public ledger.</p>\r\n\r\n<p>Blockchain was early like internet in 1990.It is very much new to us and people were not much familiar with it. It was as fundamental and parallel to internet which can potentially change our perspective of safety of record keeping systems. Imagine Blockchain as a ledger keeping entries. Let&rsquo;s say we have one universal ledger and all nodes participate in some way to that ledger. Nodes mean to different mediocre like banks, government, insurance companies etc all that are responsible for a successful transaction. Blockchain is protected by best cryptography algorithms available, which makes it very difficult to hack. Every block added is immutably linked to the last block and that block is linked to last block of itself. If anyone has to change one transaction or a block he has to change all the blocks that is the entire chain, which creates fiction, therefore super security driven by consensus, driven by immutability. There is no central core to maintain Blockchain, it is maintained by entire bunch of people. It changes the concept of trust from centralized trust to distributed trust among people. For example Agriculture is 16% of GDP of India and if we want to transform our country we have to look into agriculture. India has the highest number in agricultural land in the world. But in all these numbers there is this number, 23 number of farmers that kill themselves daily in India because of many reasons like loans, small lands, less resources for scientific agriculture etc. Blockchain can be the ideal technology to create fractional ownership among farmers helping them financially and can take care of the data entries like land owners, how much money spent etc very well. It largely reduces the chances of frauding the farmers&rsquo; important data and keep them safe easily. Another example of Energy distribution in rural areas, some areas are producing excessive power while some are producing less. Blockchain helps to maintain power distribution even, throughout the areas. The houses can be linked through solar panels and it will automatically distribute the energy in the needy areas. Much like these Blockchain helps in consolidation of small plots into a much larger plot. These examples are just a few from a wide range of profits from Blockchain.</p>\r\n\r\n<p>Blockchain adoption in India is reaching immense growth and it has a very bright future. Many Indian state governments like Telangana, Kerala, Karnataka, Andhra Pradesh and Maharashtra are vigorously supporting blockchain startups and projects and also organizing conferences on the same. There has been a considerable shift from transacting physical payments to digital currency through platforms like Paytm, Googlepay etc. Indians are gradually understanding the importance of digital currency and leveraging the seamless transactions and a cashless approach that digital currency offers. Blockchsin has paved its way into various big economical sectors like Banking and Finance sectors, healthcare, retail and logistics and is making its presence quite evident and profound</p>\r\n\r\n<p><strong>Possible challenges&nbsp;</strong>&ndash; Although the blockchain technology is extremely promising it still faces a few challenges in India. The regulations and compliance on the blockchain are still vague. The Indian government is yet to implement defined regulations on blockchain technology. The RBI and tax authorities are not in favour of cryptocurrencies and ICOs because of the issues related to the tax evasion and also lack of control of the regulators over the digital currencies. Currently testing or adoption of blockchain applications is still limited to cryptocurrencies. A successful large scale adoption of POC(proof of concept) requires the banks to hire blockchain experts or data scientists which is slightly costly as compared to hiring software developers, making its adoption difficult.</p>\r\n\r\n<p><strong>BLOCKCHAIN IS THE SOLUTION, WHAT IS THE PROBLEM?</strong></p>\r\n', , 'Jagannath Behera', '2021-09-04 07:15:27');

